More common styling in bmcweb is 

asyncResp->res.jsonValue["Status"]["State"] = "Enabled";

if (!present)
{
    asyncResp->res.jsonValue["Status"]["State"] = "Absent";
}

but oh well

```
asyncResp->res.jsonValue["Status"]["State"] = "Absent";

if (present)
{
asyncResp->res.jsonValue["Status"]["State"] = "Enabled";
}
```
is the same logic right so doesn't matter, right? the 

```
asyncResp->res.jsonValue["Status"]["State"] = "Enabled";

if (!present)
{
asyncResp->res.jsonValue["Status"]["State"] = "Absent";
}
```
is just what I have seen other places.

Also sometimes we have a default of Enabled for when the interface isn't there but that wasn't what I was talking about in this comment. 

I am fine with the if/else.

https://gerrit.openbmc.org/c/openbmc/bmcweb/+/60514/3/redfish-core/lib/fabric_adapters.hpp is doing the same thing and has a default for when the interface doesn't exist. 
Would like to be constant here, could you move line 119 to here?

                    asyncResp->res.jsonValue["Status"]["State"] = "Enabled";

